INSERT INTO `fitnessclub`.`staffs` (`id_staff`, `work_experience`, `start_working_date`, `end_working_date`, `description`, `id_user`) VALUES (1, 6, 43831, NULL, 'Администратор Наталья всегда поможет вам с выбором подходящего абонемента и направления тренировок. Смело обращайтесь к ней по всем организационным вопросам!', 1);
INSERT INTO `fitnessclub`.`staffs` (`id_staff`, `work_experience`, `start_working_date`, `end_working_date`, `description`, `id_user`) VALUES (2, 8, 43831, NULL, 'Несмотря на то, что у Галины за плечами высшее юридическое образование (юрфак БГУ), у девушки немало спортивного опыта. Имеет КМС по плаванию (долгое время состояла в сборной университета и участвовала в городских, региональных и республиканских соревнованиях). В 2015-ом закончила \"Grantello fitness school\" (курс «Универсальный инструктор»), в 2016-ом прошла дополнительное обучение по пилатесу (также на базе \"Grantello fitness school\"), а в 2017-ом закончила курс подвесного тренинга TRX в \"Академии фитнеса\" и курс по мануально-мышечному тестированию в УОЦ «Кинезио». В 2018-ом - курс по кинезиотейпированию и программе PUMP. Девушка регулярно посещает фитнес-семинары, конвенции и воркшопы, развивается в таких направлениях как пилатес, тай-бо, силовой тренинг в рамках групповых программ, 6D sliding, миофасциальный тренинг, TRX, табата, степ, смешанные форматы. Галина имеет колоссальный опыт работы с клиентами 40+ и 60+ с учетом возрастных противопоказаний и особенностей организма, с легкостью проводит персональные тренировки (без использования силовых тренажеров), консультирует по правильному питанию.', 2);
INSERT INTO `fitnessclub`.`staffs` (`id_staff`, `work_experience`, `start_working_date`, `end_working_date`, `description`, `id_user`) VALUES (3, 9, 43831, NULL, 'Светлана - один из самых опытных тренеров нашего фитнес-центра:\r Обучалась в Belarussiоn Educational Fitness Center. Является лицензированным тренером по классической аэробике (B-licence), степу (B-licence), силовому тренингу (B-licence), пилатесу (B-licence).\r Сертифицированный тренер: \r по интервальному тренингу, Тае-бо, Aero-step, Functional step, Stretching. ⠀\r Участница множества фитнес-конвенций в Беларуси и за ее пределами: Сезоны 2017 (Каунас, Литва), Сезоны-Грантелло 2013, 2017 (Минск), MIOFF 2017 (Москва, РФ), Euro Fitness Wekeend 2018 (Минск), RIMINI WELLNESS 2018, 2019 (Italy), NTC-convention 2019 (Минск).\r Светлана сумеет влюбить вас в функциональные тренировки и поможет на пути к совершенству!', 3);
INSERT INTO `fitnessclub`.`staffs` (`id_staff`, `work_experience`, `start_working_date`, `end_working_date`, `description`, `id_user`) VALUES (4, 2, 44075, NULL, 'Жанна с вами всегда на связи! Она с радостью подскажет какая тренировка будет для вас эффективнее, а также подберет абонемент исходя из ваших предпочтений.', 11);
INSERT INTO `fitnessclub`.`staffs` (`id_staff`, `work_experience`, `start_working_date`, `end_working_date`, `description`, `id_user`) VALUES (5, 4, 44075, NULL, 'Надежда закончила Полоцкий государственный университет по специальности «Практическая психология. Английский язык». За ее плечами также курсы по пилатесу и более десяти лет занятий восточными танцами: девушка не только участвовала и побеждала в городских и областных конкурсах, но и преподавала их в одном из новополоцких фитнес-клубов. Также Надежда получила комплексную программу дополнительного образования \"Фитнес-инструктор групповых программ\" (частное предприятие \"Фитнес-профи\"), прошла обучение \"Инструктор по фитнесу\" в ЧУП \"Эффект-лайн\" (пилатес, калланетика, фитнес-йога), участвовала в конвенции \"Сезоны Грантелло\", конвенции по аквааэробике и обучающем семинаре \"Стретчинг в работе инструктора групповых программ\" (Grantello fitness school).', 20);
INSERT INTO `fitnessclub`.`staffs` (`id_staff`, `work_experience`, `start_working_date`, `end_working_date`, `description`, `id_user`) VALUES (6, 10, 44075, NULL, 'Наталья - один из самых опытных тренеров нашего фитнес-центра, оцените сами: Сертифицированный тренер групповых программ, Сертифицированный тренер TRX, Сертифицированный тренер Степ 1,2 уровень, Сертифицированный тренер Stretching.\nНаталья постоянно развивается и повышает квалификацию, знакомится с новыми подходами и программами, осваивает самые современные методики фитнеса. За ее плачами многочисленные конвенций, семинары и обучения в России, Украине и Беларуси: «Nike Free Фитнес-2010г.» (Киев),  Fitnes Convention 2013 (Мир фитнеса, Минск), Конвенция «Инструктор направления Стретчинг», 2013 (Мир фитнеса, Минск), Сертификат «Международного фестиваля Физкультуры и спорта» World Class, 2010 (Москва), Конвенция «Grantello fitness festival» 2010, 2012, 2013, 2015 (Минск), Конвенции «Стабильная сила» (Pilates, Gyroplastica) 1 уровень», 2010 (Мир фитнеса, Минск), Обучающий семинар «Aero Dance, Step Dance PRO 1-2 уровень» А. Художилова, 2011 (Минск), Воркшоп «Поперечный шпагат», Анатомия Фитнеса, 2018, Сертификат «Стретчинг в групповом формате», «Fitness factory», 2018, «NTC-convintion», 2019. \nНаталья – это профессионал высокого уровня и мотиватор, который даст толчок к действиям, поддержит на пути к самосовершенствованию, проявит нужную строгость, не давая расслабляться. С ней у вас будет возможность постоянно держать себя в форме.', 30);
