INSERT INTO `fitnessclub`.`workouts` (`id_workout`, `name_workout`, `id_workout_level`, `description`) VALUES (1, 'Pilates', 1, 'Пилатес – комплекс динамичных, но не резких упражнений, направленных на развитие эластичности позвоночника, проработку всех мышц, связок и суставов. К тому же, это действенный способ убрать лишние сантиметры и килограммы!\nГлавная отличительная черта – отсутствие ограничений: такие тренировки полезны и детям, и взрослым, и даже беременным женщинам. Пилатес – это:\nодновременно изоляционное и комплексное влияние тренировок на тело. Каждое упражнение направлено на нагрузку сразу нескольких групп мышц, а это заменяет целый комплекс занятий;\nулучшение координации и стабилизация позвоночника. Здесь работает принцип «чем медленнее, тем действеннее»: нагрузка дается дозированно и не приводит к переутомлению организма. Каждый подбирает для себя темп индивидуально;\nтренировка силы «изнутри». Проработка «медленных» мышц, которые держат внутренние органы и скелет;\nбезусловная польза для женщин: упражнения направлены на укрепление мышц таза и проработку проблемных зон. Это помогает при родах и в процессе послеродового восстановления;\nрастягивание. Хорошая растяжка – важный элемент пилатеса: она помогает восстановить мышцы после интенсивных нагрузок, развить гибкость и убрать скованность движений;\nособое дыхание. В процессе тренировки воздухом наполняется нижняя часть легких и все мышцы, которые задействованы при выполнении определенного упражнения, насыщаются кислородом.');
INSERT INTO `fitnessclub`.`workouts` (`id_workout`, `name_workout`, `id_workout_level`, `description`) VALUES (2, 'Total body', 2, 'Total body - cовокупность силовых упражнений, выполняемых по разнообразным сценариям и проработка всех групп мышц, обеспечение интенсивного сжигания калорий.\nПодходит для людей c любым уровнем физподготовки.');
INSERT INTO `fitnessclub`.`workouts` (`id_workout`, `name_workout`, `id_workout_level`, `description`) VALUES (3, 'Step', 2, 'STEP — это разновидность аэробных программ с элементами танцев и использованием степ-платформы. … Программы сочетают лучшие черты аэробики, степ-фитнеса и танцев и являются эффективным средством для похудения и приведения тела в отличную спортивную форму.\nSTEP: танцуй, чтобы похудеть!\nНе тратьте время зря — расставляйте акценты и как можно скорее начинайте преобразовывать проблемные зоны в достоинства!');
INSERT INTO `fitnessclub`.`workouts` (`id_workout`, `name_workout`, `id_workout_level`, `description`) VALUES (4, 'PUMP', 3, 'PUMP — это интенсивная тренировка с мини-штангой, разработанная группой известных фитнес-тренеров Les Mills. PUMP — жиросжигающая тренировка на все тело (спина, руки, грудь, ноги, ягодицы, пресс) сочетает в себе силовую и аэробную нагрузку, проходит в высоком темпе и с большим количеством повторений упражнений, поэтому не только поможет вам похудеть, но и сделает ваше тело подтянутым и рельефным! Результат просто ошеломительный, и тысячи последователей программы являются ярким тому подтверждением.\n Преимущества «BODY PUMP»:\nтренировка универсальна как для мужчин, так и для женщин\nвы сами регулируете нагрузку, меняя вес штанги\nтехника выполнения упражнений тщательно контролируется профессиональным инструктором\nна тренировке невозможно «перекачаться», зато возможно обрести рельефное тело мечты');
INSERT INTO `fitnessclub`.`workouts` (`id_workout`, `name_workout`, `id_workout_level`, `description`) VALUES (5, 'Interval training', 3, 'Уже пробовали пилатес или аэробику? Ваш стиль тренировок больше не дает результата? Или вы достаточно хорошо подготовлены физически, но хотите быстро сбросить вес? Тогда попробуйте интервальную тренировку! \nМетод Interval training дает вам возможность скинуть лишние килограммы и сантиметры за месяц. Благодаря высокой нагрузке и чередованию различных упражнений интервальные занятия:\nускорят метаболизм не только на время тренировки, но и в течение 24 часов после нее;\nпомогут равномерно проработать все группы мышц;\nпозволят дать новую нагрузку на сердечно-сосудистую систему;\nулучшат выносливость и помогут легче справляться с кардио упражнениями средней интенсивности.\nИнтервальные тренировки проводятся на групповых занятиях. Тренеры рекомендуют посещать не более 2-3 занятий в неделю, а по возможности чередовать их с нагрузкой средней интенсивности или спокойными упражнениями. Поскольку Interval training – это:\n40-50 минут постоянной интенсивной нагрузки в высоком темпе;\nчередование активных периодов (20-30 сек) и коротких периодов отдыха (10 сек);\nчередование упражнений на разные группы мышц;\nдискомфорт, пот, усталость и огромная гордость за свою силу воли после выполнения тренировки.');
INSERT INTO `fitnessclub`.`workouts` (`id_workout`, `name_workout`, `id_workout_level`, `description`) VALUES (6, 'Fitness Mix', 2, 'Не можете определиться с направлением для тренировок? Выбирайте все сразу: ждем вас на занятиях Fitness Mix! Fitness Mix – это взрывное сочетание всего лучшего из мира фитнеса. Занятия включают силовую, аэробную нагрузку, stretching, калланетику. Fitness Mix – для тех, кто стремится к гармоничному развитию и улучшению физической формы! \nТакие тренировки – отличная возможность улучшить координацию движений, повысить выносливость организма и обрести хорошую фигуру: сбросить лишний вес, проработать и скорректировать проблемные места. В процессе тренировки работают различные группы мышц, поэтому достигается максимальный эффект.\nТренировка состоит из нескольких блоков:\nРазминка: для разогрева мышц и подготовки к следующим нагрузкам.\nОсновная часть: силовой блок и аэробная тренировка, калланетика, элементы пилатеса.\nЗаминка. Stretching и расслабление всех групп мышц.\nТренировка проходит под руководством профессионального инструктора: он следит за всеми участницами и контролирует, чтобы все элементы выполнялись правильно.\nБлагодаря Fitness Mix теперь вам не нужно выделять отдельный день для растяжки, подбирать специальные комплексы упражнений «на верх» и «на низ»: всё это мы уже собрали в нашей программе!');
INSERT INTO `fitnessclub`.`workouts` (`id_workout`, `name_workout`, `id_workout_level`, `description`) VALUES (7, 'Stretching', 1, 'Мечтаете развить гибкость тела, растяжку связок и мышц? Мечтаете о красивой осанке? Приходите на занятия по стретчингу! Стретчинг развивает грациозность тела, подвижность и гибкость суставов и мышц. Такие занятия подходят новичкам, увеличивают результат тренировок (кардио- и силовых). Регулярные занятия стретчингом нормализуют работу сердечно-сосудистой системы и ускоряют обмен веществ, улучшают работу всего организма в целом.\nМы предлагаем 2 вида занятий:\nСтатистические. Комплекс статических упражнений готовит к более серьезным нагрузкам, развивает координацию, делает кожу более упругой. Подходит, если раньше вы не занимались растяжкой и другими спортивными нагрузками. Методика основана на плавных движения и удержании различных поз в течение 30 секунд.\nСиловые. Подходит тем, кто раньше занимался растяжкой и имеет спортивную подготовку. Предназначен для профессиональных и полупрофессиональных спортсменов. Такая растяжка снижает риск получить травму во время спортивных нагрузок, обеспечивает правильное формирование ткани мышц, увеличивает эффект от силовых тренировок.\nУже через 3 месяца регулярных тренировок вы увидите результат: повысится выносливость и тело придет в тонус.');
INSERT INTO `fitnessclub`.`workouts` (`id_workout`, `name_workout`, `id_workout_level`, `description`) VALUES (8, 'Body sculpt', 2, 'Ищете тип занятий, с которыми ваша фигура станет стройной и спортивной, а выносливость и уровень физической подготовки вырастут? Выбирайте занятия силовой аэробикой Body Sculpt! Упражнения подойдут для людей любого возраста и физической подготовки, причем:\nзанятия проходят в спокойном ритме, благодаря чему укрепляют мышцы, но не приводят к их росту;\nупражнения ускоряют метаболизм, положительно влияют на сердечно-сосудистую систему, укрепляют здоровье;\nулучшается гибкость и эластичность мышц, нормализуется осанка.');
INSERT INTO `fitnessclub`.`workouts` (`id_workout`, `name_workout`, `id_workout_level`, `description`) VALUES (9, 'Functional training', 3, 'Выбираете силовые тренировки и хотите развить координацию, а также выносливость и мышечную силу? Функциональный тренинг – то, что вам нужно! На тренировках вы:\nнаучитесь гармонично двигаться;\nпроработаете все группы мышц;\nсбросите лишний вес.\nВ тренировку входят:\nбег и ходьба с тренажерами;\nупражнения, которые имитируют ежедневные действия;\nдополнительный разогрев мышц.\nЗаниматься функциональный тренингом можно с любым уровнем подготовки. На занятиях длительностью 55 минут используются мячи, свободные веса или гантели. Движения, которые вы совершаете во время тренировок, похожи на повседневные, поэтому вы:\nснимете напряжение в суставах;\nснизите вероятность получения травм;\nпроработаете все мышцы, включая глубокие.');
